import React, {useEffect, useState} from 'react';
import Coverage from './Coverage';
import './App.css';

const pages = {
  COVERAGE: 0,
  EXTRAS:   1
}
var currentPage = pages.COVERAGE;

const App = () => {
  const [eligible, setEligible] = useState([]);

  const getEligible = async () => {
    // TODO: Add eligible data
    // await fetch()
    //   .then((response) => {
    //     return response.json();
    //   })
    //   .then((data) => {
    //     setEligible(data);
    //   });
  }

  useEffect(() => {
    getEligible();
  }, []);

  if(currentPage == pages.COVERAGE) return (<div></div>) + (
    <div className="App">
      <header>
        <span id="Menu">Menu</span>
        <span>Benefits</span>
      </header>
      <Coverage plan={eligible.plan}/>
      <footer>
        <span className="Current-selection">Coverage</span>
        <span>Extras</span>
      </footer>
    </div>
  );
  else if(currentPage == pages.EXTRAS) return (
    <div></div>
  );
}

export default App;
